    let i=0;
    return (
        <div>
        <div className="keys">
            {   
                letters.map((letter,index)=>{
                   return  (<button > <Key letter={letter}/></button>)
                })
            }
        </div>
        <input type="text"/>
        </div>
    );
        }
 }
 export default Keys
